#imports
import pygame as pg
import time

#-----------------------------------------------------------
# global variables, for easy modifications
    
# dimensions of the game board
DIMENSIONS = [154, 79]

# Whether the game board allows wrapping around the edges
WRAP = True

# the numbers of adjacent live cells which allow a live cell to survive
SURVIVE = [2, 3]

# The numbers of adjacent live cells which allow a dead cell to become alive
REPRODUCE = [3]

# The side length of each cell, in px
CELLSIZE = 10

# The time it takes for a generation step, in seconds
STEPTIME = 0.05

#-----------------------------------------------------------
# Class for the game board
class Board:
    # Constructor
    def __init__(self, dimx, dimy, wrap, cellsize):
        
        # Store each cell as a boolean, for whether it is alive or dead
        self.cells = [[False for i in range(dimy) ] for j in range(dimx)]

        self.dimx = dimx
        self.dimy = dimy
        self.wrap = wrap
        self.cellsize = cellsize
    
    # Returns the number of live adjacent cells around a specific coordinate
    def get_live_adjacents(self, x, y):
        
        # variable for the total number of adjacent live cells
        live_total = 0
        
        # Loop through [-1, 0, 1] so that the adjacent coordinates are easily incremented
        for i in range(-1, 2):
            for j in range(-1, 2):
                
                # Make sure the count does not include the middle cell
                if not (i == 0 and j == 0):
                    
                    if not self.wrap:
                        
                        #check that the cell being checked is within bounds
                        if x+i in range(self.dimx) and y+j in range(self.dimy):
                            if self.cells[x + i][y + j]:
                                live_total += 1
                                
                    # behavior for wrapping
                    else:
                        #use modulus to wrap the edges back to the other side
                        wrapx = (x+i) % self.dimx
                        wrapy = (y+j) % self.dimy
                        if self.cells[wrapx][wrapy]:
                            live_total += 1
                        
        return live_total
    
    # toggle a specific cell alive/dead
    def toggle_cell(self, x, y):
        self.cells[x][y] = not self.cells[x][y]
    
    # clear the board
    def clear(self):
        self.cells = [[False for i in range(self.dimy) ] for j in range(self.dimx)]
    
    # step to the next generation
    def update(self):
        
        # empty array of cells, to be edited
        newcells = [[False for i in range(self.dimy) ] for j in range(self.dimx)]
        
        #loop through each cell
        for i in range(self.dimx):
            for j in range(self.dimy):
                
                # behavior if cell is alive
                if self.cells[i][j]:
                    if self.get_live_adjacents(i,j) in SURVIVE:
                        newcells[i][j]=True
                    else:
                        newcells[i][j]=False
                        
                #behavior if cell is dead
                else:
                    if self.get_live_adjacents(i,j) in REPRODUCE:
                        newcells[i][j]=True
                    else:
                        newcells[i][j]=False
                        
        #sets the array to the updated version
        self.cells = newcells
        
    # Returns a pygame.Surface to be displayed
    def render(self):
        #creates a pygame Surface with dimensions corresponding to the dimensions of the board
        surface = pg.Surface((self.dimx*self.cellsize, self.dimy*self.cellsize))
        
        # fill with gray
        surface.fill((20,20,20))
        
        #loop through each cell
        for i in range(self.dimx):
            for j in range(self.dimy):
                
                #if the cell is alive, draws a corresponding white square
                if self.cells[i][j]:
                    
                    # calculating pixel coordinates for its drawing position
                    xcoord = (i) * self.cellsize
                    ycoord = (j) * self.cellsize
                    #create a Rect object to draw; cellsize-1 so a grid is recognizable
                    rect = pg.Rect(xcoord, ycoord, self.cellsize-1, self.cellsize-1) # 
                    #draw the Rect object
                    pg.draw.rect(surface, (255,255,255), rect)
                    
                #draw a black square if cell is dead
                else:
                    # calculating pixel coordinates for its drawing position
                    xcoord = (i) * self.cellsize
                    ycoord = (j) * self.cellsize
                    #create a Rect object to draw; cellsize-1 so a grid is recognizable
                    rect = pg.Rect(xcoord, ycoord, self.cellsize-1, self.cellsize-1)
                    #draw the Rect object
                    pg.draw.rect(surface, (0,0,0), rect)

        return surface

#-----------------------------------------------------------
# Main function (will be run when the entire program is run)
def main():
    
    # Lets us modify global variables in this scope
    global DIMENSIONS, WRAP, SURVIVE, REPRODUCE, CELLSIZE, STEPTIME
    # initialize the pygame module
    pg.init()
    # load and set the caption
    pg.display.set_caption("Conway's Game of Life")
    
    # create a surface on screen with dimensions corresponding to the size of the board
    screen = pg.display.set_mode((DIMENSIONS[0]*CELLSIZE, DIMENSIONS[1]*CELLSIZE))
     
    # define variables to control the main loop
    running = True
    pause = True
    
    #create the board
    board = Board(DIMENSIONS[0], DIMENSIONS[1], WRAP, CELLSIZE)
    
    # render and display the board
    screen.blit(board.render(), (0,0))
    pg.display.flip()
    
    #timer for knowing when to update the board automatically
    prevtime = 0
    
    # main loop
    while running:
        # event handling, gets all events from the event queue
        for event in pg.event.get():
            
            # Do something if the event is of type QUIT (if the red x button is clicked)
            if event.type == pg.QUIT:
                # change the value to False, to exit the main loop
                running = False
            
            # If mouse is clicked, toggle the corresponding square
            if event.type == pg.MOUSEBUTTONDOWN:
                #position of click in pixels
                x_px = pg.mouse.get_pos()[0]
                y_px = pg.mouse.get_pos()[1]
                
                # the cell which the click corresponds to
                x = x_px // CELLSIZE
                y = y_px // CELLSIZE
                
                #toggle the cell
                board.toggle_cell(x, y)
                
                # update the display
                screen.blit(board.render(), (0,0))
                pg.display.flip()
            
            #keypress events
            if event.type == pg.KEYDOWN:
                
                # if space is pressed, toggle pause
                if event.key == pg.K_SPACE:
                    pause = not pause
                    
                # when paused, right arrow key allows you to go to the next generation
                if event.key == pg.K_RIGHT and pause:
                    # step to the next generation
                    board.update()
                    
                    # re-render
                    screen.blit(board.render(), (0,0))
                    pg.display.flip()
                
                # Up arrow increases the step time, making the automatic playing slower
                if event.key == pg.K_UP:
                    STEPTIME += 0.05
                    
                # Down arrow decreases the step time, making the automatic playing faster
                if event.key == pg.K_DOWN:
                    STEPTIME -= 0.05
                    
                # If delete is pressed, the board is cleared
                if event.key == pg.K_DELETE:
                    # clear the board
                    board.clear()
                    # re-render
                    screen.blit(board.render(), (0,0))
                    pg.display.flip()
                    
                # If p key is pressed, print cell array to terminal (for saving patterns)
                if event.key == pg.K_p:
                    print(board.cells)
        
        # when not paused, let GOL play automatically
        if not pause: 
            
            # if current time minus the time at the last step is greater than STEPTIME, then render again
            if time.time() - prevtime >= STEPTIME:
                board.update()
                screen.blit(board.render(), (0,0))
                pg.display.flip()
                
                # log the time the board was last rendered
                prevtime = time.time()
    # quit the pygame instance (closes the window)
    pg.quit()
    
#-----------------------------------------------------------
# run the main function only if this module is executed as the main script
# (if you import this as a module then nothing is executed)
if __name__=="__main__":
    # call the main function
    main()


